package com.fyp.bambino;

import androidx.appcompat.app.AppCompatActivity;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.graphics.Canvas;
import android.graphics.Matrix;
import android.os.Bundle;
import android.util.Base64;
import android.util.Log;
import android.widget.ImageView;

import java.io.ByteArrayOutputStream;
import java.io.IOException;
import java.io.UnsupportedEncodingException;

public class SplashScreen extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_splash_screen);

        String p0 = "";
        String p1 = "";
        String p2 = "";
        String p3 = "";
        String p4 = "";
        String p5 = "";
        String p6 = "";
        String p7 = "";
        String p8 = "";
        String pL = "";

        byte[] dp0 = Base64.decode(p0, Base64.DEFAULT);
        byte[] dp1 = Base64.decode(p1, Base64.DEFAULT);
        byte[] dp2 = Base64.decode(p2, Base64.DEFAULT);
        byte[] dp3 = Base64.decode(p3, Base64.DEFAULT);
        byte[] dp4 = Base64.decode(p4, Base64.DEFAULT);
        byte[] dp5 = Base64.decode(p5, Base64.DEFAULT);
        byte[] dp6 = Base64.decode(p6, Base64.DEFAULT);
        byte[] dp7 = Base64.decode(p7, Base64.DEFAULT);
        byte[] dp8 = Base64.decode(p8, Base64.DEFAULT);
        byte[] dpL = Base64.decode(pL, Base64.DEFAULT);

        ByteArrayOutputStream outputStream = new ByteArrayOutputStream( );
        try {
            outputStream.write( dp0 );
            outputStream.write( dp1 );
            outputStream.write( dp2 );
            outputStream.write( dp3 );
            outputStream.write( dp4 );
            outputStream.write( dp5 );
            outputStream.write( dp6 );
            outputStream.write( dp7 );
            outputStream.write( dp8 );
            outputStream.write( dpL );
        } catch (IOException e) {
            throw new RuntimeException(e);
        }


        byte c[] = outputStream.toByteArray( );

        Bitmap b = BitmapFactory.decodeByteArray(c, 0, c.length);

        ImageView imageView = this.findViewById(R.id.imageView2);

        Matrix matrix = new Matrix();

        matrix.postRotate(90);

        Bitmap scaledBitmap = Bitmap.createScaledBitmap(b, b.getWidth(), b.getHeight(), true);

        Bitmap rotatedBitmap = Bitmap.createBitmap(scaledBitmap, 0, 0, scaledBitmap.getWidth(), scaledBitmap.getHeight(), matrix, true);

        imageView.setImageBitmap(rotatedBitmap);
    }
}